    function logout(){
        setCurrentUser(null);
    }

    const options = [
        { key:'artworks', path:'/', text:'Raregifs'},
        { key:'collections', path:'/users', text:'Collections'},
        { key:'storage', path:'/storage', text:'Storage' },
        { key:'upload', path:'/upload', text:'Upload' },        
    ]

    return( 
        <Dropdown pointing='top left'>
            <Dropdown.Menu>
                <Dropdown.Item text="Raregifs" icon="raregifs" as={Link} to='/artworks'/>
